import Netflix from "./Netflix"
import Hotstar from "./Hotstar"
import Card from "./Card"
import details from "./Details_page"

// const choice ="netflix";
const choice = "amazon"; 

function Choice (){
if(choice === "netflix"){
    return (
        <>
        <Netflix/>
        </>
    );
}
else {
    return (
    <>
    <Hotstar/>
    </>
    )
}
}

function choice2(){

if (choice === "amazon")
{
    return (
        <>
              <Card 
          card_img = {details[15].card_img}
          links = {details[15].links}
          title = {details[15].title}
          headname ={details[15].headname}
        /> 
        </>
    )
}
}


export default Choice;
